import * as React from "react";
import Box from "@mui/material/Box";
import { Grid, IconButton, Link, Typography, Stack, TextField, Button, InputAdornment } from "@mui/material";
import PersonIcon from "@mui/icons-material/Person";
import PhoneInTalkIcon from "@mui/icons-material/PhoneInTalk";
import EmailIcon from "@mui/icons-material/Email";

function Contact() {
  return (
    <>
      <Box
        component="main"
        textAlign="center"
        sx={{ p: 3, backgroundColor: "#ddd" }}
      >
        <Stack spacing={2} direction="row" justifyContent="space-evenly" mb={1}>
          <Box>sdfmnsdkfns</Box>
          <Box>
            <form>
              <Stack direction="column" spacing={2}>
                <TextField
                  id="outlined-basic"
                  label="Full Name"
                  variant="outlined"
                  startAdornment={
                    <InputAdornment position="start">
                      <P/>
                    </InputAdornment>
                  }
                />
                <TextField
                  id="outlined-basic"
                  label="Mobile Number"
                  variant="outlined"
                />
                <TextField
                  fullWidth
                  id="outlined-basic"
                  label="Email Id"
                  variant="outlined"
                />
                <Button variant="outlined">Submit</Button>
              </Stack>
            </form>
          </Box>
        </Stack>
      </Box>
    </>
  );
}
export default Contact;
